rows = full.strip().splitlines()
rows = [list('.' + row + '.') for row in rows]
empty = list('.' * len(rows[0]))
rows = [empty] + rows + [empty]
#for row in rows:
#    print(row)

count = 0
found = True
while found:
    found = False
    for y in range(1, len(rows) - 1):
        for x in range(1, len(rows[0]) - 1):
            if rows[y][x] == '@':
                ns = rows[y][x - 1] + rows[y][x + 1] + ''.join(rows[y - 1][x - 1 : x + 2] + rows[y + 1][x - 1 : x + 2])
                if ns.count('@') < 4:
                    rows[y][x] = '.'
                    count += 1
                    found = True
                    print(f'{y=} {x=}')
print(count)
